const myImage = new Image();
myImage.src =
  "data:image/jpeg;base64,";
myImage.addEventListener("load", function() {
  const canvas = document.getElementById("canvas1");
  const ctx = canvas.getContext("2d");
  canvas.width = 464;
  canvas.height = 514;

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height); //Scans area of canvas for pixel information (red,green,blue, alpha of image)
  //console.log(pixels);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particleArrays = [];
  const numberOfParticles = 5000;

  let mappedImage = []; //To hold brightness values of each pixel in the image along with that pixel's X and Y coordinates
  //Go thorogh pixels
  for(let y = 0; y < canvas.height; y++){
    let row = []; //Hold pixel data for each row
    for(let x = 0; x < canvas.width; x++){
        const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]; //every 4 elements in the pixels array represent one pixel
        const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
        const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
        const brightness = calculateRelativeBrightness(red, green, blue);
        const cell = [
            cellBrightness = brightness,
            cellColor = [red, green, blue]
        ];
        row.push(cell);
    }
    mappedImage.push(row);
  }

//human eyes don't perceive red, green and blue the same. 
//The same amount of red is not the same brightness as the same amount of blue.
//This function will take the red,green and blue we calculated above and adjust them by diffrent amount based on human brightness perception

function calculateRelativeBrightness(red, green, blue){
    return Math.sqrt(
        (red * red) * 0.299 +
        (green * green) * 0.587 +
        (blue * blue) * 0.114
    ) / 100;
}

  class Particle {
      constructor(){
          this.x = Math.random() * canvas.width;
          this.y = 0;
          this.speed = 0;
          this.velocity = Math.random() * 1; //to give a diffrent speed on falling down
          this.size = Math.random() * 1.5 + 1;
          this.position1= Math.floor(this.y); //To compare with mappedImage array, the index should be integer
          this.position2= Math.floor(this.x);
        
      }

      update(){
        this.position1= Math.floor(this.y);
        this.position2= Math.floor(this.x);
        this.speed = mappedImage[this.position1][this.position2][0]; //To get the brightness of the same pixel
        this.movement = (2.5 - this.speed) + this.velocity; //Dark particle with speed/brightness of 0 would move faster than the bright ones
        
        this.y += this.movement;
        if(this.y >= canvas.height){
            this.y = 0;
            this.x = Math.random() * canvas.width;
        }
      }

      draw(color){
        ctx.beginPath();
        ctx.fillStyle = `rgb(${color[0]},${color[1]},${color[2]})`;
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
      }
  }

  function init(){
      for(let i = 0; i < numberOfParticles; i ++){
          particleArrays.push(new Particle);
      }
  }
  init();

  function animate(){
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0, 0, 0)';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for(let i = 0; i< particleArrays.length; i++){
        particleArrays[i].update();
        ctx.globalAlpha = particleArrays[i].speed * 0.5;
        const color = mappedImage[particleArrays[i].position1][particleArrays[i].position2][1]
        particleArrays[i].draw(color);
    }
    requestAnimationFrame(animate);
  }

  animate();
});